            <title>【环球外汇网】每日交易提醒130816</title>
            <link>http://www.youku.com/v_show/id_XNTk2NjQ5ODgw_rss.html</link>
            <description><![CDATA[<a href="http://www.youku.com/v_show/id_XNTk2NjQ5ODgw_rss.html"><img src="http://g4.ykimg.com/0100641F46520D927BF0C00625838C0C0D2929-1CA7-548C-5693-C532D29B9657" border="0" width="120" height="90" vspace="4" hspace="4" title="【环球外汇网】每日交易提醒130816" target="_blank" /></a> <a href="http://www.youku.com/v_show/id_XNTk2NjQ5ODgw_rss.html"><img src="http://g3.ykimg.com/0100641F46520D927A3D8D0625838CD09FFBCA-20C7-C287-BD80-AF69CBE76C3A" border="0" width="120" height="90" vspace="4" hspace="4" title="【环球外汇网】每日交易提醒130816" target="_blank" /></a> <a href="http://www.youku.com/v_show/id_XNTk2NjQ5ODgw_rss.html"><img src="http://g2.ykimg.com/0100641F46520D927D1F080625838C432F7C95-C310-4E8B-3BD3-F1BBF85ED50B" border="0" width="120" height="90" vspace="4" hspace="4" title="【环球外汇网】每日交易提醒130816" target="_blank" /></a> <p>周五亚洲时段，市场缺乏关键性交投线索，可关注澳洲联储主席助理德贝尔的讲话；进入欧洲时段，投资者可关注欧元区6月经常帐、欧元区7月消费者物价指数、美国7月营建许可、美国8月密歇根大学消费者信心指数数据，料给汇市提供进一步交投线索。

澳洲联储主席助理德贝尔讲话

澳洲联储主席助理德贝尔将于北京时间9:30在澳洲金融市场协会与澳洲联储的发布会上讲话。投资者可关注他本人对于澳元当前汇率的看法，若他本人在讲话中仍表达出对于澳元当前汇率高估的看法，澳元可能会遭遇抛压，如果讲话未出现任何实质性内容，澳元变动可能不大。

欧元区6月经常帐

欧洲央行将于北京时间16:00公布欧元区6月未季调经常帐数据。目前预计，7月未季调经常帐盈余180亿欧元，上个月为盈余95亿欧元。若公布的数据高于预期，欧元料受到一定支持，若不及预期，甚至经常帐盈余进一步收窄，欧元料受打压。

欧元区7月消费者物价指数

欧盟统计局将于北京时间17:00公布欧元区7月调和消费者物价指数数据。目前预计年率终值为增长1.6%，月率为下降0.5%。若公布的数据不及预期，则将表明欧洲央行仍存进一步宽松空间，欧元料受打压，反之，若数据高于预期，欧元可能受到一定程度支持。
</p>]]></description>
